import NotFound from './ui/components/NotFound';
// import LoginPage from './ui/components/LoginPage'
// import FriendsContainer from './ui/components/Friends'
// import FooterComponent from './ui/common/footer'
import React, * as react from 'react';
import { Provider } from 'react-redux';
import { Switch, Route } from 'react-router-dom';
import { ConnectedRouter } from 'connected-react-router';
import { ProtectedRoutes } from './ui/routes/ProtectedRoutes';
import { PublicRoutes } from './ui/routes/PublicRoutes';
import history from './reduxStore/store'

// eslint-disable-next-line react/prefer-stateless-function
class App extends react.Component {
	render() {
		return (
			<Provider>
					<ConnectedRouter history={history}>
						<Switch>
							<Route exact path="/login" component={PublicRoutes} />
							<Route path="/" component={ProtectedRoutes} />
							<Route component={NotFound} />
						</Switch>
					</ConnectedRouter>
			</Provider>
		);
	}
}

export default App;
